import React from 'react'

export default function analytics() {
  return (
      <div className="space-y-10">

      {/* KPI Cards */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="bg-white p-6 rounded-xl shadow">
          <h2 className="text-lg font-semibold">Total Users</h2>
          <p className="text-2xl font-bold mt-2">120</p>
        </div>

        <div className="bg-white p-6 rounded-xl shadow">
          <h2 className="text-lg font-semibold">Total Scans</h2>
          <p className="text-2xl font-bold mt-2">340</p>
        </div>

        <div className="bg-white p-6 rounded-xl shadow">
          <h2 className="text-lg font-semibold">Images Uploaded</h2>
          <p className="text-2xl font-bold mt-2">256</p>
        </div>
      </div>

      {/* Line Chart Example */}
      <div className="bg-white p-6 rounded-xl shadow">
        <h3 className="text-xl font-bold mb-4">Daily Scan Activity</h3>
        <Line
          data={{
            labels: ["Mon", "Tue", "Wed", "Thu", "Fri", "Sat", "Sun"],
            datasets: [
              {
                label: "Scans per Day",
                data: [12, 19, 7, 14, 22, 30, 25],
                borderWidth: 2,
              },
            ],
          }}
        />
      </div>

      {/* Pie Chart Example */}
      <div className="bg-white p-6 rounded-xl shadow">
        <h3 className="text-xl font-bold mb-4">Skin Type Distribution</h3>
        <Pie
          data={{
            labels: ["Oily", "Dry", "Combination", "Normal"],
            datasets: [
              {
                data: [40, 20, 25, 15],
              },
            ],
          }}
        />
      </div>
    </div>
  )
}
